  [],\n\t\"revision_timestamp\": \"2013-03-15T10:30:51.927307\",\n\t\"name\": \"digital-geologic-map-of-palo-alto-battlefield-national-historic-site-and-vicinity-texas-nps-grd\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Digital Geologic Map of Palo Alto Battlefield
  National Historic Site and vicinity, Texas is composed of GIS data layers complete
  with ArcMap 9.2 layer (.LYR) files, two ancillary GIS tables, a Windows Help File
  with ancillary map text, figures and tables, a FGDC metadata record and a 9.2 ArcMap
  (.MXD) Document that displays the digital map in 9.2 ArcGIS. The data were completed
  as a component of the Geologic Resource Evaluation (GRE) program, a National Park
  Service (NPS) Inventory and Monitoring (I&M) funded program that is administered
  by the NPS Geologic Resources Division (GRD). Source geologic maps and data used
  to complete this GRE digital dataset were provided by the following: Bureau of Economic
  Geology, The University of Texas at Austin, and McCulloch Archeological Services
  (MAS) report. Detailed information concerning the sources used and their contribution
  the GRE product are listed in the Source Citation sections(s) of this metadata record
  (paal_metadata.txt; available at http://nrdata.nps.gov/paal/nrdata/geology/gis/paal_metadata.xml).
  All GIS and ancillary tables were produced as per the NPS GRE Geology-GIS Geodatabase
  Data Model v. 2.0. (available at: http://science.nature.nps.gov/im/inventory/geology/GeologyGISDataModel.cfm).
  The GIS data is available as a 9.2 personal geodatabase (paal_geology.mdb), and
  as shapefile (.SHP) and DBASEIV (.DBF) table files. The GIS data projection is NAD83,
  UTM Zone 14N. That data is within the area of interest of Palo Alto Battlefield
  National Historic Site.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
